import React, { useState } from "react";
import {
  StyleSheet,
  Text,
  TextInput,
  View,
  TouchableOpacity,
  Alert,
  Image,
} from "react-native";
import AsyncStorage from "@react-native-async-storage/async-storage";
import EyeOpen from "../../components/EyeOpen";
import EyeClosed from "../../components/EyeClosed";
import { API_BASE_URL } from "../../utils/apiConfig";

const LoginScreen = ({ navigation }) => {
  const [seePassword, setSeePassword] = useState(true);
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [isLoading, setIsLoading] = useState(false);

  const handleLogin = async () => {
    if (!email || !password) {
      Alert.alert("ÏïåÎ¶º", "Ïù¥Î©îÏùºÍ≥º ÎπÑÎ∞ÄÎ≤àÌò∏Î•º Î™®Îëê ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.");
      return;
    }

    setIsLoading(true);

    try {
      console.log("Î°úÍ∑∏Ïù∏ ÏãúÎèÑ:", { email, password: "***" });

      const response = await fetch(`${API_BASE_URL}api/token/`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          email,
          password,
        }),
      });

      console.log("ÏùëÎãµ ÏÉÅÌÉú:", response.status);

      const responseText = await response.text();
      console.log("ÏùëÎãµ Î≥∏Î¨∏:", responseText);

      let data;
      try {
        data = JSON.parse(responseText);
      } catch (e) {
        console.error("JSON ÌååÏã± Ïò§Î•ò:", e);
        Alert.alert("Ïò§Î•ò", "ÏÑúÎ≤Ñ ÏùëÎãµÏùÑ Ï≤òÎ¶¨Ìï† Ïàò ÏóÜÏäµÎãàÎã§.");
        setIsLoading(false);
        return;
      }

      if (response.ok && data.access) {
        console.log("‚úÖ ÌÜ†ÌÅ∞ Î∞úÍ∏â ÏÑ±Í≥µ");

        // üîπ Access Token, Refresh Token, Email, Password Ï†ÄÏû•
        await AsyncStorage.setItem("accessToken", data.access);
        await AsyncStorage.setItem("refreshToken", data.refresh);
        await AsyncStorage.setItem("userEmail", email);
        await AsyncStorage.setItem("userPassword", password); // ‚ùó ÏûêÎèô Î°úÍ∑∏Ïù∏ÏùÑ ÏúÑÌï¥ passwordÎèÑ Ï†ÄÏû•

        console.log("üîπ Î°úÍ∑∏Ïù∏ ÏÑ±Í≥µ, MainTabÏúºÎ°ú Ïù¥Îèô ÏãúÎèÑ");
        navigation.navigate("MainTab");
      } else {
        console.log("‚ùå Î°úÍ∑∏Ïù∏ Ïã§Ìå®:", data);
        //Alert.alert('Ïò§Î¶¨ÍΩ•Î•ò', data.detail || 'Î°úÍ∑∏Ïù∏Ïóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
        Alert.alert(
          "Ïò§Î•ò",
          "Î°úÍ∑∏Ïù∏ Ï†ïÎ≥¥Í∞Ä ÏùºÏπòÌïòÏßÄ ÏïäÏäµÎãàÎã§.\nÎã§Ïãú ÌôïÏù∏Ìï¥ Ï£ºÏÑ∏Ïöî."
        );
      }
    } catch (error) {
      console.error("‚ùå Login error:", error);
      Alert.alert("Ïò§Î•ò", "ÎÑ§Ìä∏ÏõåÌÅ¨ Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.");
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Î°úÍ∑∏Ïù∏</Text>

      <Text style={styles.label}>Ïù¥Î©îÏùº</Text>
      <TextInput
        style={styles.input}
        placeholder="Ïù¥Î©îÏùº(ÏïÑÏù¥Îîî)Î•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî"
        placeholderTextColor="#CCCDD0"
        value={email}
        onChangeText={setEmail}
        keyboardType="email-address"
        autoCapitalize="none"
      />

      <Text style={styles.label}>ÎπÑÎ∞ÄÎ≤àÌò∏</Text>
      <View style={styles.inputContainer}>
        <TextInput
          style={styles.inputField}
          placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî"
          placeholderTextColor="#CCCDD0"
          secureTextEntry={seePassword}
          value={password}
          onChangeText={setPassword}
        />
        <TouchableOpacity
          onPress={() => setSeePassword(!seePassword)}
          style={styles.icon}
        >
          {seePassword ? <EyeClosed /> : <EyeOpen />}
        </TouchableOpacity>
      </View>

      <TouchableOpacity
        style={[styles.button, isLoading && styles.buttonDisabled]}
        onPress={handleLogin}
        disabled={isLoading}
      >
        <Text style={styles.buttonText}>
          {isLoading ? "Î°úÍ∑∏Ïù∏ Ï§ë..." : "Î°úÍ∑∏Ïù∏"}
        </Text>
      </TouchableOpacity>

      <View style={styles.buttonContainer}>
        <TouchableOpacity
          onPress={() => navigation.navigate("FindId")}
          style={styles.findIdButton}
        >
          <Text style={styles.findIdText}>Ïù¥Î©îÏùº Ï∞æÍ∏∞</Text>
        </TouchableOpacity>

        <TouchableOpacity
          onPress={() => navigation.navigate("FindPassword")}
          style={styles.findPasswordButton}
        >
          <Text style={styles.findPasswordText}>ÎπÑÎ∞ÄÎ≤àÌò∏ Ï∞æÍ∏∞</Text>
        </TouchableOpacity>

        <TouchableOpacity
          onPress={() => navigation.navigate("SignUp1")}
          style={styles.signUpButton}
        >
          <Text style={styles.findPasswordText}>ÌöåÏõêÍ∞ÄÏûÖ</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#003340",
    alignItems: "center",
    justifyContent: "center",
    paddingHorizontal: 30,
  },
  title: {
    fontSize: 24,
    fontWeight: "bold",
    color: "#F074BA",
    position: "absolute",
    top: 150,
    left: 30,
  },
  label: {
    fontSize: 16,
    color: "#F074BA",
    alignSelf: "flex-start",
    marginTop: 10,
    marginBottom: 10,
  },
  input: {
    width: "100%",
    height: 50,
    borderWidth: 1,
    borderColor: "#ddd",
    borderRadius: 8,
    paddingHorizontal: 15,
    marginBottom: 5,
    fontSize: 16,
    backgroundColor: "#f9f9f9",
    color: "black",
  },
  inputContainer: {
    flexDirection: "row",
    alignItems: "center",
    width: "100%",
    borderWidth: 1,
    borderColor: "#ddd",
    borderRadius: 8,
    backgroundColor: "#f9f9f9",
    marginBottom: 15,
    paddingHorizontal: 10,
  },
  inputField: {
    flex: 1,
    height: 50,
    fontSize: 16,
    color: "black",
  },
  icon: {
    padding: 10,
  },
  button: {
    width: "100%",
    height: 50,
    backgroundColor: "#F074BA",
    borderRadius: 8,
    alignItems: "center",
    justifyContent: "center",
    position: "absolute",
    bottom: 80,
  },
  buttonDisabled: {
    backgroundColor: "#d3d3d3",
  },
  buttonText: {
    color: "#fff",
    fontSize: 18,
    fontWeight: "bold",
  },
  buttonContainer: {
    flexDirection: "row",
    marginTop: 10,
    paddingHorizontal: 10,
  },
  findIdButton: {
    alignItems: "center",
    marginRight: 10,
  },
  findIdText: {
    color: "#EFF1F5",
    fontSize: 16,
  },
  findPasswordButton: {
    alignItems: "center",
    marginRight: 80,
  },
  findPasswordText: {
    color: "#EFF1F5",
    fontSize: 16,
  },
  signUpButton: {
    alignItems: "center",
  },
  signUpText: {
    color: "#EFF1F5",
    fontSize: 16,
  },
});

export default LoginScreen;
